'''Sulliusceps''' are a type of mushroom found in the [[Tar Swamp]] on [[Fossil Island]]. Chopping sulliusceps requires level 65 in [[Woodcutting]] to chop, and grants the player 127 experience per yield.

Players can receive [[mushroom]]s and [[mort myre fungus]] from chopping sulliusceps, and can also receive a [[sulliuscep cap]] at a rate of 1/100, which is used in creating [[mushroom pie]]s. In addition, they also yield [[numulite]] and [[unidentified fossil]]s fairly commonly, making chopping sulliusceps one of the fastest ways to obtain fossils for [[Kudos]].

Sulliusceps have a 1/16 chance per successful chop to deplete.

Players '''cannot''' obtain [[bird nest]]s from chopping sulliusceps. However, they can receive [[clue nest]]s.

