==Locations==
[[File:Sulliuscep_rotation.png|thumb|left|The strategy method for cutting sulliusceps.]]
There are six sulliusceps found throughout the [[Tar Swamp]], indicated by the [[File:Rare trees icon.png]] icon, but only one is large enough to be chopped down at any given time, while all other locations will have sulliuscep sprouts in their location. Players must traverse the Tar Swamp to find the choppable sulliuscep, the location of which is unique to each player, so [[world switching]] will not change its location. Once chopped, the next sulliuscep will spawn, the location of which cycles through the same sequence over and over and is shown in the image.

To get to the first one, player can use either [[Magic Mushtree]] or [[rubber cap mushroom]]. The rubber cap mushroom is '''not''' recommended unless you have filled the mud pit with 9 [[Mushroom|bittercap mushrooms]] at the landing site. If you take the rubber cap without a mushy bed to land on you can sustain high damage. Hits up to 50 are not uncommon.

==XP Rates==
Cutting [[sulliuscep]] mushroom trees on [[Fossil Island]] offers the [[Pay-to-play Woodcutting training|fastest woodcutting experience]] when not using any sort of tick manipulation. Players must have completed [[Bone Voyage]] for this method. Additionally, a high [[Hitpoints]] level is recommended to ensure a full run as [[tar monster]]s can hit fairly frequently with a max hit of 9 along with [[spine mushroom]]s that can hit up to a 10, as well as inflict [[poison]]. Due to the damage taken with this method of training, an absolute minimum of 11 Hitpoints (one above the maximum hit of spine mushrooms) is strongly recommended. See [[Sulliuscep/Strategies|the strategies page]] for more information.

Experience rates scale depending on the Woodcutting level. At level 75, players can gain up to around 80,000 experience per hour, increasing to around 97,000 experience per hour at level 90 and 100,000–110,000 experience per hour at level 99. In total, to achieve level 99 woodcutting from 65, you will have to cut 97,778 sulliusceps assuming you wear the [[lumberjack outfit]].

== Loot from 65-99 ==
Assuming players keep the [[sulliuscep cap]]s, the [[numulite]] and [[unidentified fossil]]s, on average they will receive 978 sulliuscep caps, around 264,000 numulite, 1394 [[unidentified small fossil]]s, 698 [[unidentified medium fossil]]s, 559 [[unidentified large fossil]]s and 140 [[unidentified rare fossil]]s. Assuming the sulliuscep caps and the numulite are sold on the grand exchange, this is worth {{Coins|{{GEP|Sulliuscep cap|978}} + {{GEP|Numulite|264000}}}} coins. Furthermore, 120k experience in a skill of choice is obtained from completing the fossil exhibit in the Varrock Museum, which leaves you with 1,324 small, 638 medium, 509 large and 140 rare fossils. These can be cleaned and used at the [[mycelium pool]] to calcify them using [[pyrophosphite]] and [[calcite]]. The recalcified bones can then be used on the easternmost strange machine in the [[House on the Hill]] for a total of 2,031,750 [[Prayer]] experience. The remaining 254 plant fossils may be traded in for another 76k numulite. Alternatively, if you do not clean the unidentified large fossils, they are guaranteed to work in the mycelium pool without risking the chance of them becoming plant fossils.

